  const {yes, no} = useState([])

 return (
    <div>
  <TestJackie />
  <motion.h1 
  animate={{fontSize: 60, color: "#c7000b", x: 100, y: 10 }}
  transition={{ type:"spring", stiffness: 120 }}

  >

    test
  </motion.h1>
  <input type="text" />
  <button>yes</button>
   <button>No</button>
   </div>
  )
}

export default App;
